function mobileNavigationToggle(e){var n=document.getElementById(e);n.onclick=function(){n.classList.toggle("pressed"),document.getElementById("main-navigation").classList.toggle("open")};for(var t=document.querySelectorAll(".main-navigation-parent-item a"),o=0;o<t.length;o++)t[o].onclick=function(){this.parentNode.classList.toggle("open")}}